import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const Name = ()=>{
  return(
    <h1>Manik</h1>
  );
}

const Id = ()=>{
  return(
     <h1>1</h1>
  );
}

const Email = ()=>{
  return(
    <h1>manik@gmail.com</h1>
  )
}

function User(){
  return(
    <div className="usermain">
      <Name/>
      <Id/>
      <Email/>
    </div>
  );
}

ReactDOM.render(<User />, document.getElementById('root'));
